import React from 'react';
import './JoinPage.css';


const JoinPage = () => {
  return (
    <div className="about-container">
      <h1 className="about-title">A propos</h1>
      <p className="about-description">
      Chez Fit Learning, nous croyons que le fitness est pour tout le monde, indépendamment du genre.
       Nous sommes là pour vous accompagner dans votre parcours de remise en forme, que vous soyez un homme ou une femme.
       Notre approche du fitness repose sur l'idée que chaque individu est unique, avec des objectifs
        et des besoins spécifiques. 
        Notre équipe d'experts qualifiés est là pour vous guider et vous aider à atteindre vos objectifs, 
        qu'il s'agisse de perdre du poids, de renforcer votre corps, 
        d'améliorer votre endurance ou simplement de maintenir une bonne santé.
         Nous proposons des séances d'entraînement personnalisées, adaptées à votre niveau de condition physique et à vos 
         aspirations.
          De plus, nos conseils nutritionnels vous aideront à équilibrer votre alimentation pour soutenir vos efforts.
           Rejoignez notre communauté inclusive et motivante dès aujourd'hui, et ensemble,
            nous atteindrons des résultats extraordinaires, que vous soyez un homme ou une femme.



      </p>
    </div>
  );
};

export default JoinPage;
